import React from 'react';
import './CandidateNumber.css'

const CandidateNumber = () => {
	return(
		<div className="group Candidatesprop">
		  <p className="Candidates"> No of Candidates: </p>
		  <p className="number">25</p>
		</div>
		);
};

export default CandidateNumber;
